import path from 'path';
import WebpackShellPlugin from 'webpack-shell-plugin-next';

export default {
	entry:  './client/js/App.js',
	output: {
		path: path.join(__dirname, './dist'),
		filename: '[name]-bundle.js'
	},
    mode: 'development',
	watch: true,
	module: {
		rules: [
			{
				test: /\.js?$/,
				exclude: '/node_modules/',
