			{
				test: /\.scss$/,
				exclude: '/node_modules/',
				use: ['style-loader', 'css-loader', 'sass-loader']
			}
		]
	},
	plugins: [
		new WebpackShellPlugin({
			onBuildStart: {
				scripts: ['echo "Starting"'],
				blocking: true,
				parallel: false
			},
			onBuildEnd: {
				scripts: ['node -r @babel/register ./server/server.js'],
				blocking: false,
				parallel: true
			}
		})
	],
	resolve: {
		extensions: ['.js', '.scss']
	}
}

