import express from 'express';
import states from './states.json';

const router = express.Router();

router.get('/', (req, res) => {
	if (typeof req.query.term === 'undefined') {
		res.status(500).send({
			error: 'You must provide a search term'
		});
	}

	let filtered = [],
		count = 0;

	if(req.query.term === ''){
		res.send({
			count,
			data: filtered
		});
